import { BrowserRouter, Routes, Route } from "react-router-dom"
import Registration from "./components/Registration"

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
         <Route path="/" element={<Registration/>}/>
      </Routes>
    </BrowserRouter>
  )
}

export default App
